(880, 249, '_elementor_data', '[{\"id\":\"267a5044\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"2fce2cb3\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"30bbf52a\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p><!-- wp:paragraph {\\\"textColor\\\":\\\"very-light-gray\\\"} --><\\/p>\\n<p class=\\\"has-text-color has-very-light-gray-color\\\">\\u00a0<\\/p>\\n<p><!-- \\/wp:paragraph --><!-- wp:image {\\\"id\\\":296,\\\"align\\\":\\\"left\\\",\\\"width\\\":696,\\\"height\\\":138} --><\\/p>\\n<div class=\\\"wp-block-image\\\">\\u00a0<\\/div>\\n<p><!-- \\/wp:image --><!-- wp:paragraph --><\\/p>\\n<p><!-- \\/wp:paragraph --><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false},{\"id\":\"a3c1482\",\"elType\":\"section\",\"settings\":[],\"elements\":[{\"id\":\"568e078\",\"elType\":\"column\",\"settings\":{\"_column_size\":100},\"elements\":[{\"id\":\"d05d7c8\",\"elType\":\"widget\",\"settings\":{\"editor\":\"<p class=\\\"has-text-color has-very-light-gray-color\\\" style=\\\"caret-color: #000000; color: #000000;\\\"><a href=\\\"http:\\/\\/https\\/\\/lulis2002.wixsite.com\\/shadesofpink\\\">http:\\/\\/https:\\/\\/lulis2002.wixsite.com\\/shadesofpink<\\/a><\\/p>\\n<p class=\\\"has-text-color has-very-light-gray-color\\\" style=\\\"caret-color: #000000; color: #000000;\\\">Anteriormente eh realizado algunos trabajos pero sin duda alguna el que mas me ah apasionado y donde eh sacado toda mi creatividad es SHADES OF PINK este sitio es un blog dedicado a dar tips de para la mujer como de maquillaje, moda y peinados<\\/p>\\n<p class=\\\"has-text-color has-very-light-gray-color\\\" style=\\\"caret-color: #000000; color: #000000;\\\">al ir dedicado un poco mas hacia la belleza femenina tiene una paleta de colores rosa y grises que ayudan a que sea un ambiente mas c\\u00e1lido<\\/p>\\n<p class=\\\"has-text-color has-very-light-gray-color\\\" style=\\\"caret-color: #000000; color: #000000;\\\">como podemos observa en la parte superior del lado izquierdo tengo los apartados de HOME, OBJETIVO, BLOG, MAKEUP TUTORIAL, MORE. y por la parte de abajo contamos con un peque\\u00f1o recuadro para que el usuario pueda tener una visita mas c\\u00f3moda al sitio y poder ver que canciones est\\u00e1n en el top del momento<\\/p>\\n<p class=\\\"has-text-color has-very-light-gray-color\\\" style=\\\"caret-color: #000000; color: #000000;\\\">del lado derecho est\\u00e1n los iconos de redes sociales<\\/p>\\n<div class=\\\"wp-block-image\\\" style=\\\"caret-color: #000000; color: #000000;\\\">\\n<p>\\u00a0<\\/p>\\n<\\/div>\\n<p>\\u00a0<\\/p>\\n<p><span style=\\\"color: #000000;\\\">si seguimos dando hacia abajo encontramos las opciones que nos llevaran anteriormente a las ya mencionadas\\u00a0<\\/span><\\/p>\\n<p><span style=\\\"color: #000000;\\\">\\u00a0<\\/span><\\/p>\\n<p><img class=\\\"wp-image-296\\\" style=\\\"caret-color: #000000; color: #000000;\\\" src=\\\"http:\\/\\/134.209.42.237\\/wp-blog-2019\\/wp-content\\/uploads\\/2019\\/11\\/Captura-de-Pantalla-2019-11-14-a-las-5.27.02-p.-m.-1024x205.png\\\" alt=\\\"\\\" width=\\\"696\\\" height=\\\"138\\\" \\/><span style=\\\"color: #000000;\\\"><br \\/><\\/span><\\/p>\\n<p style=\\\"caret-color: #000000; color: #000000;\\\"><img class=\\\"alignnone size-medium wp-image-318\\\" src=\\\"http:\\/\\/134.209.42.237\\/wp-blog-2019\\/wp-content\\/uploads\\/2019\\/11\\/Captura-de-Pantalla-2019-11-14-a-las-6.26.38-p.-m.-300x145.png\\\" alt=\\\"\\\" width=\\\"300\\\" height=\\\"145\\\" \\/><\\/p>\"},\"elements\":[],\"widgetType\":\"text-editor\"}],\"isInner\":false}],\"isInner\":false}]'),
