(240, 1, '2019-11-06 05:21:20', '2019-11-06 05:21:20', '<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\">Definitivamente la comida es una de mis cosas favoritas en el mundo, sobre todo cuando se trata de probar cosas nuevas y de diferentes culturas</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\">aqui te menciono mis top 5 de restaurantes y comidas favoritas, enjoy the little things!!!!</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":242,\"align\":\"right\",\"width\":423,\"height\":282} -->\n<div class=\"wp-block-image\"><figure class=\"alignright is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/Lasagna-FEATURE.jpg\" alt=\"\" class=\"wp-image-242\" width=\"423\" height=\"282\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\">#1  en nuestra primera posición se encuentra la lasagna, sin duda alguna es de mis platillos favoritos por todo lo que contiene, la mejor que eh probado aqui en victoria es la de PRANA se ubica en la calle chihuahua cerca del boulevard Tamaulipas, aparte de deliciosa la porción es de un muy buen tamaño </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":243,\"align\":\"left\",\"width\":352,\"height\":352} -->\n<div class=\"wp-block-image\"><figure class=\"alignleft is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/maca.jpg\" alt=\"\" class=\"wp-image-243\" width=\"352\" height=\"352\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\">#2 quise agregar un postre ya que una buena comida siempre va acompañada de postres!! defintivamente uno que me robo el corazón desde la primera vez que lo probé son los macarons, este postre de origen Frances ademas de ser de diferentes sabores y tamaños, tiene una forma de preparación bastante complicada , es por eso que en muy pocos lugares de la ciudad los venden </p>\n<!-- /wp:paragraph -->', 'FOOD LOVER', '', 'publish', 'closed', 'closed', '', 'food-lover', '', '', '2019-11-06 17:54:07', '2019-11-06 17:54:07', '', 0, 'http://134.209.42.237/wp-blog-2019/?page_id=240', 0, 'page', '', 0),
