(253, 1, '2019-11-06 05:53:43', '2019-11-06 05:53:43', '<!-- wp:paragraph -->\n<p>leer es una de las cosas que mas disfruto hacer, ya que puede estar soleado, lloviendo en la playa, en mi casa o porque no incluso en el parque es algo que te relaja dependiendo de la lectura que mayor te interesa va a ser un mundo nuevo al que puedes entrar. a continuación te presento algunas recomendaciones de libros que a mi me han atrapado completamente.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>#1<strong> La mujer de mi vida. Nicolas barreu </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>«Hoy he visto a la mujer de mi vida. Estaba sentada en mi café favorito. Por desgracia, no estaba sola. Un tipo condenadamente atractivo estaba a su lado y cogía su mano. Pero, de repente, ocurrió algo. La mujer de mi vida se levantó para ir al baño y a la vuelta me guiñó un ojo y me dio su tarjeta».  este maravilloso y romántico libro se desarrolla en la ciudad de parís, asi es la ciudad del amor, un libro que te atrapa con la trama de principio a fin con cada uno de los personajes </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":250,\"width\":168,\"height\":260} -->\n<figure class=\"wp-block-image is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/la-mujer-de-mi-vida_9788467040067.jpg\" alt=\"\" class=\"wp-image-250\" width=\"168\" height=\"260\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>#2 Harry potter. JK.Rowling</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>claramente uno que no podía faltar en nuestra bella lista es toda la saga de Harry potter ya que esta junto con sus 7 libros te transportan completamente a un mundo nuevo, porque quien no ah soñado con hacer magia? o simplemente la idea de poder volar en una escoba y sentir la emoción y libertad que los personajes describen en los libros suena emocionante \"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>\"Resulta extraño pensar que, cuando uno teme algo que va a ocurrir y quisiera que el tiempo empezara a pasar más despacio, el tiempo suele pasar más aprisa.\"</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Narrador.<br>Harry Potter y el Cáliz de Fuego. Capitulo 19. El colacuerno húngaro</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":251,\"width\":601,\"height\":468} -->\n<figure class=\"wp-block-image is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/saga-harry-potter-7-libros-j-k-rowling-salamandra-D_NQ_NP_272405-MLA20859862295_082016-F-1024x799.jpg\" alt=\"\" class=\"wp-image-251\" width=\"601\" height=\"468\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p><strong>#3 La ladrona de libros. Markus Zusak</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Érase una vez un pueblo donde las noches eran largas y la muerte contaba su propia historia...</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Una novela preciosa, tremendamente humana y emocionante, que describe las aventuras de una niña alemana de nueve años desde que es dada en adopción por su madre hasta el final de la guerra. Su nueva familia, gente sencilla y nada afecta al nazismo, le enseña a leer y a través de los libros Liesel logra distraerse durante los bombardeos y combatir la tristeza. Pero es el libro que ella misma está escribiendo el que finalmente le salvará la vida. en mi opino un éxito completamente tanto el libro como la película, ambos los recomiendo al 100%</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":252,\"width\":467,\"height\":344} -->\n<figure class=\"wp-block-image is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/La-ladrona-de-libros-32.jpg\" alt=\"\" class=\"wp-image-252\" width=\"467\" height=\"344\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->', 'Books', '', 'inherit', 'closed', 'closed', '', '249-revision-v1', '', '', '2019-11-06 05:53:43', '2019-11-06 05:53:43', '', 249, 'http://134.209.42.237/wp-blog-2019/?p=253', 0, 'revision', '', 0),
(254, 1, '2019-11-06 06:03:30', '2019-11-06 06:03:30', '<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\">Para mi este es uno de los apartados mas importantes ya que contare un poquito mas de mi y mi familia </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\">comencemos con que soy la mas pequeña de mi bella familia conformada por mi hermosa madre y mi hermana mayor, ellas fueron las encargadas de criarme y de siempre estar conmigo en mis mejores y peores momentos, todo lo que soy se los debo a ellas a continuación se las presentare, tambien les presentare a uno de mis mas grandes amores, mi perro romeo porque estoy segura que mi vida no seria igual sin el </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":273,\"align\":\"left\",\"width\":206,\"height\":275} -->\n<div class=\"wp-block-image\"><figure class=\"alignleft is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/mommm.jpg\" alt=\"\" class=\"wp-image-273\" width=\"206\" height=\"275\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\">esta bella señora que ven aqui es mi madre, ella realmente es la persona que mas admiro y la persona mas fregona que conozco en el mundo entero </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\">esta bella señorita de aqui  abajo es mi hermana mayor heissel, egresada de tecnológico de victoria de la carrera de ingeniería en sistemas tiene 35 años asi que si, mi hermana mayor podría ser mi mama </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":274,\"align\":\"right\",\"width\":269,\"height\":359} -->\n<div class=\"wp-block-image\"><figure class=\"alignright is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/b314be01-89ae-461d-a124-fa5cc767685f-768x1024.jpg\" alt=\"\" class=\"wp-image-274\" width=\"269\" height=\"359\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:image {\"id\":276,\"align\":\"left\",\"width\":268,\"height\":268} -->\n<div class=\"wp-block-image\"><figure class=\"alignleft is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/IMG_2748.jpg\" alt=\"\" class=\"wp-image-276\" width=\"268\" height=\"268\"/></figure></div>\n<!-- /wp:image -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\">ahora si, lo mejor de mi día a día y lo mejor que me pudieron haber dado, mi mascota romeo, romeo es un perro de 2 años de raza shitzu es color cafe y practicamente es una bolita de pelo, pero eso no impide que lo ame </p>\n<!-- /wp:paragraph -->', 'MY LIFE', '', 'publish', 'closed', 'closed', '', 'my-life', '', '', '2019-11-06 18:18:25', '2019-11-06 18:18:25', '', 0, 'http://134.209.42.237/wp-blog-2019/?page_id=254', 0, 'page', '', 0),
