(277, 1, '2019-11-06 07:15:02', '2019-11-06 07:15:02', '<!-- wp:paragraph -->\n<p>Para mi este es uno de los apartados mas importantes ya que contare un poquito mas de mi y mi familia </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>comencemos con que soy la mas pequeña de mi bella familia conformada por mi hermosa madre y mi hermana mayor, ellas fueron las encargadas de criarme y de siempre estar conmigo en mis mejores y peores momentos, todo lo que soy se los debo a ellas a continuación se las presentare, tambien les presentare a uno de mis mas grandes amores, mi perro romeo porque estoy segura que mi vida no seria igual sin el </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>esta bella señora que ven aqui es mi madre, ella realmente es la persona que mas admiro y la persona mas fregona que conozco en el mundo entero </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":273,\"width\":285,\"height\":380} -->\n<figure class=\"wp-block-image is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/mommm.jpg\" alt=\"\" class=\"wp-image-273\" width=\"285\" height=\"380\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>esta bella señorita de aqui es mi hermana mayor heissel, egresada de tecnológico de victoria de la carrera de ingeniería en sistemas tiene 35 años asi que si, mi hermana mayor podría ser mi mama </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":274,\"width\":388,\"height\":517} -->\n<figure class=\"wp-block-image is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/b314be01-89ae-461d-a124-fa5cc767685f-768x1024.jpg\" alt=\"\" class=\"wp-image-274\" width=\"388\" height=\"517\"/></figure>\n<!-- /wp:image -->\n\n<!-- wp:paragraph -->\n<p>ahora si, lo mejor de mi día a día y lo mejor que me pudieron haber dado, mi mascota romeo, romeo es un perro de 2 años de raza shitzu es color cafe y practicamente es una bolita de pelo, pero eso no impide que lo ame </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:image {\"id\":276,\"width\":386,\"height\":386} -->\n<figure class=\"wp-block-image is-resized\"><img src=\"http://134.209.42.237/wp-blog-2019/wp-content/uploads/2019/11/IMG_2748.jpg\" alt=\"\" class=\"wp-image-276\" width=\"386\" height=\"386\"/></figure>\n<!-- /wp:image -->', 'MY LIFE', '', 'inherit', 'closed', 'closed', '', '254-revision-v1', '', '', '2019-11-06 07:15:02', '2019-11-06 07:15:02', '', 254, 'http://134.209.42.237/wp-blog-2019/?p=277', 0, 'revision', '', 0),
